publisher = ""
points1 = []
points2 = []

def message_callback(msg):
	global points1
	data = msg.data

	max_data_point = 1

	delta_x_sensor1 = 0
	delta_y_sensor1 = 0
	rotation_sensor_1 = 0

	max_angle = 85 * math.pi / 180;

	min_distance = 100
	
	points = []
	for index, data_point in enumerate(data):
		angle = max_angle - max_angle * 2 * index / 511
		angle += rotation_sensor_1
		dist_x_s1 = math.cos(-angle) * data_point / max_data_point
		dist_y_s1 = math.sin(-angle) * data_point / max_data_point
		dist_x_robot = dist_x_s1 + delta_x_sensor1
		dist_y_robot = dist_y_s1 + delta_y_sensor1
		points.append([[0, 0], [dist_x_robot, dist_y_robot]])
		distance = math.sqrt(dist_x_robot * dist_x_robot + dist_y_robot * dist_y_robot)
		if distance < min_distance:
			min_distance = distance

	points1 = points.copy()
	points.extend(points2)
	print(points);
	minimum = min(data)
	print(minimum)
	publisher.publish(minimum)

def message_callback_2(msg):
	global points2
	data = msg.data

	max_data_point = 1

	delta_x_sensor1 = 0
	delta_y_sensor1 = 0
	rotation_sensor_1 = (180 + 45) * math.pi / 180

	max_angle = 135 * math.pi / 180

	min_distance = 100
	
	points = []
	for index, data_point in enumerate(data):
		angle = max_angle - max_angle * 2 * index / 511
		angle += rotation_sensor_1
		dist_x_s1 = math.cos(-angle) * data_point / max_data_point
		dist_y_s1 = math.sin(-angle) * data_point / max_data_point
		dist_x_robot = dist_x_s1 + delta_x_sensor1
		dist_y_robot = dist_y_s1 + delta_y_sensor1
		points.append([[0, 0], [dist_x_robot, dist_y_robot]])
		distance = math.sqrt(dist_x_robot * dist_x_robot + dist_y_robot * dist_y_robot)
		if distance < min_distance:
			min_distance = distance

	points2 = points.copy()
	#points.extend(points1)
	#print(points);
	minimum = min(data)
	print(minimum)
	publisher.publish(minimum)

def main():
	rospy.init_node("safety_node")
	global publisher
	publisher = rospy.Publisher("/safety_level", std_msg_f32, queue_size=10) # (topicName, messageType, bufferSize)
	rospy.Subscriber("/safety_sensor_data", std_msg_f32_array, message_callback)
	rospy.Subscriber("/safety_sensor_data_2", std_msg_f32_array, message_callback_2)

	while not rospy.is_shutdown():
		rospy.spin()


